// stage content:
(lib.Main = function(mode,startPosition,loop,reversed) {
if (loop == null) { loop = true; }
if (reversed == null) { reversed = false; }
	var props = new Object();
	props.mode = mode;
	props.startPosition = startPosition;
	props.labels = {start:9,endOrSkip:44,skip:80};
	props.loop = loop;
	props.reversed = reversed;
	cjs.MovieClip.apply(this,[props]);
	this.actionFrames = [0,7,42,79,117];
	// timeline functions:
	this.frame_0 = function() {
		this.stop();
		var cs = createjs;
		var _this = this;
		var _stage = _this.stage;
		var point1, point2, block1, block2, currBlocks;
		var answerBlock, allBlocksMC, currBlockNames, isAnimating, toyPrefix;
		var _puzzContainer_mc = _this.puzzContainer_mc;
		var _endScreen = "endScreen";
		var _switchMarker_mc = new lib["switchMarker_mc"]();
		var _guidePic_mc = _this.guidePic_mc;
		//var _winAnim_mc = _this.winAnim_mc;
		var _starsScore_mc = _this.starsScore_mc;
		var audioMute = false;
		var allToyPrefix = ["toyA_", "toyB_", "toyC_"];
		var totalScore = 0;
		var currentToyNum = 0;
		var locXArr = [-96,0,96];
		var locYArr = [-96,0,96];
		var tileTotal = 9;
		var columns = 3;
		var rows = 3;
		var firstClick = true;
		cs.Sound.registerSound("../_bin/sounds/spark.mp3", "spark");
		//_this.stage.enableMouseOver(3);
		_this.btn_skip.addEventListener("click", skip.bind(this));
		_this.btn_start2.addEventListener("click", start.bind(this));
		//this.btn_replay.addEventListener("click", replayClick.bind(this));
		//this.btnMute.addEventListener("click", volumeClick.bind(this));
		addBoxes();
		function addBoxes(){
			var imgArr;
			var num = 0;
			allBlocksMC = new Array();
			answerBlock = new Array();
			currBlockNames = new Array();
			toyPrefix = allToyPrefix[currentToyNum];
			currBlocks = [0,1,2,3,4,5,6,7,8];
			fisherYates(currBlocks); //Randomize the order
			for(var i=0; i<rows; i++){
				for(var a=0; a<columns; a++){
					img[i] = new lib[toyPrefix +currBlocks[num]]();
					img[i].name = toyPrefix + currBlocks[num];
					img[i].x = locXArr[a];
					img[i].y = locYArr[i];
					_puzzContainer_mc.addChild(img[i]);
					currBlockNames.push(img[i].name);
					answerBlock.push(toyPrefix + num);
					allBlocksMC.push(img[i]);
					num++;
					img[i].addEventListener("click", clickFunction.bind(this));
				}
			}
			var toyGuide = new lib[toyPrefix]();
			toyGuide.gotoAndStop(toyGuide.totalFrames - 1);
			_guidePic_mc.addChild(toyGuide);
			_switchMarker_mc.visible = false;
			_puzzContainer_mc.addChild(_switchMarker_mc);
		}
		function start(e){
			_this.gotoAndPlay("start");
			//nextRound();	
		}
		function skip(e){
			//console.log("hello" + _this.currentFrame);
			if(_this.currentFrame == "42"){
				_this.gotoAndPlay("endOrSkip");
			}else{
				_this.gotoAndPlay("skip");
			}
			//nextRound();	
		}
		function clickFunction(e){
			if (isAnimating) return;
			if(firstClick){
				block1 = e.currentTarget;
				point1 = new cs.Point(block1.x,e.currentTarget.y);
				_switchMarker_mc.x = block1.x;
				_switchMarker_mc.y = block1.y;
				_switchMarker_mc.visible=true;
				firstClick = false;
			}else
			{
				//e.currentTarget["hover_btn"].gotoAndStop(0);
				_switchMarker_mc.visible=false;
				block2 = e.currentTarget;
				point2 = new cs.Point(block2.x,e.currentTarget.y);
				firstClick = true;
				switchLoc(block1, point2);
			}
		}
		function switchLoc(theMC, toPoint){
			isAnimating = true;
			cs.Sound.play("spark");
			cs.Tween.get(theMC).to({x:toPoint.x,y:toPoint.y}, 500, cs.Ease.circOut);
			cs.Tween.get(block2).to({x:point1.x,y:point1.y}, 500, cs.Ease.circOut).call(switchComplete);	
		}
		function switchComplete(){
			isAnimating = false;
			switchInArray(allBlocksMC,allBlocksMC.indexOf(block1),allBlocksMC.indexOf(block2));
			switchInArray(currBlockNames,allBlocksMC.indexOf(block1),allBlocksMC.indexOf(block2));
			if(answerBlock.toString()==currBlockNames.toString()){
				if (currentToyNum < allToyPrefix.length) correctAnim();
				else endGame();
			}
		}
		function correctAnim(){
			totalScore++;
			_starsScore_mc.gotoAndStop(totalScore);
			//_winAnim_mc.gotoAndPlay(2);
			cs.Tween.get(this).wait(4000).call(endNa);
			//cs.Tween.get(this).wait(1800).call(nextRound);
		}
		function endNa(){
			_this.gotoAndPlay("endOrSkip");
		}
		function nextRound(){
			currentToyNum ++;
			firstClick = true;
			_switchMarker_mc.visible=false;
			if (currentToyNum < allToyPrefix.length) {
				_puzzContainer_mc.removeAllChildren();
				_guidePic_mc.removeAllChildren();
				addBoxes();
			}
			else {
				endGame();
			}
		}
		function endGame(){
			_this.gotoAndPlay(_endScreen);
			console.log("show end");
		}
		function replayClick(e){
			currentToyNum = 0;
			totalScore = 0;
			_puzzContainer_mc.removeAllChildren();
			_guidePic_mc.removeAllChildren();
			firstClick = true;
			addBoxes();
			this.gotoAndPlay("gameStart");	
		}
		function volumeClick(e){
			if(audioMute == true){
				this.btnMute.mcAudioIcon.gotoAndStop(0);
				cs.Sound.setVolume(1);
				audioMute = false;
			}else{
				this.btnMute.mcAudioIcon.gotoAndStop(1);
				cs.Sound.setVolume(0);
				audioMute = true;
			}
		}
		//RANDOMIZER
		function fisherYates( array ){
			var count = array.length,
			randomnumber,
			temp;
			while( count ){
				randomnumber = Math.random() * count-- | 0;
				temp = array[count];
				array[count] = array[randomnumber];
				array[randomnumber] = temp
			}
			return array;
		}
		//SWITCHING ARRAY POSSITION
		function switchInArray(arr, indexA, indexB) {
			  var temp = arr[indexA];
			  arr[indexA] = arr[indexB];
			  arr[indexB] = temp;
		}
	}

		this.stop();
	}
	this.frame_42 = function() {
